Bicycle Quick Use
Quickly use iConsole SDK in Android projects. For specific usage, refer to examples and Demo
Example
First create a class that inherits the Application class or add the following code to the onCreate method of the existing Application class:
public class App extends Application {

    @Override
    public void onCreate() {
        super.onCreate();

        //APP_ID Need to apply
        BoQun.createInstance(APP_ID, this);

    }
}

Add name="XXX" under the application node in the project AndroidManifest.xml file (XXX is the Application class just now)







Can be used in Activity or Service
public class BikeActivity extends AppCompatActivity {

    @Override
    protected void onCreate(@Nullable Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);

        //Initialize the instance
        BoQunBike.init(new OnBikeListener() {
            @Override
            public void onResponseConfigInfo(BikeConfigInfo info) {

            }

            @Override
            public void onResponseSportStatus(int status) {

            }

            @Override
            public void onResponseSportData(int stepCount, int rpm, int heartRate) {

            }

            @Override
            public void onResponseLoadLevel(int load) {

            }

            @Override
            public void onResponseInclineLevel(int incline) {

            }

            @Override
            public void onResponseFanLevel(int level) {

            }

            @Override
            public void onExternalKeyEvent(int keyCode) {

            }

            @Override
            public void onError(int errorCode) {

            }
        });

        BoQunBike.queryConfigInfo();

        //Get current Load
        BoQunBike.queryMachineInfo(BoQunBike.TYPE_LOAD_LEVEL);

        //Get current sport status
        BoQunBike.queryMachineInfo(BoQunBike.TYPE_SPORT_STATUS);



    }

    @Override
    protected void onDestroy() {
        super.onDestroy();
        //Destroy the instance
        BoQunBike.destroy();
    }
}

